import React from 'react';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

import GridListItem from 'components/grid-list-item'

import './grid-list.css'


const elements = (data) => data.map( (data) => {
      return   <GridListTile
                key = {data.id}>
                  <GridListItem
                      {...data}
                    />
                </GridListTile>
    }
  )

export default  TitlebarGridList = () => {
  const { data } = this.props;
  return (
    <div className="root">
      <GridList cellHeight={180} className="grid-list">
        { (data) => data.map( (data) => {
              return   <GridListTile
                        key = {data.id}>
                          <GridListItem
                              {...data}
                            />
                        </GridListTile>
            }) }
      </GridList>
    </div>
  );
}
